import React from 'react';

const VideoList = ({ videos, onSelectVideo }) => {
    return (
        <div>
            <h2>Available Videos</h2>
            <ul>
                {videos.map(video => (
                    <li key={video.id}>
                        <button onClick={() => onSelectVideo(video)}>
                            {video.title}
                        </button>
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default VideoList;
